script: |
  super -f text -I q2123.spq | sort > q2123.out

inputs:
  - name: q2123.spq
    data: |
      SELECT DISTINCT 99 FROM tab1 (FORMAT parquet) WHERE NOT ( col2 * - col0 - - col0 ) NOT IN ( - 14 * - col2 ) OR col1 / - col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q2123.out
    data: |
      99
